import React from 'react'
import classes from './ColorPicker.module.css'


const ColorPicker = ({ children, onChange, ...props }) => {
    return (
        <div>
            <input {...props} onChange={onChange} className={classes.myColorPicker} type="color" />
            <label for="works2">works</label> <input type="color" id="works2" value="#000002" onChange="{alert(this.value);" />
        </div>

    )
}

export default ColorPicker
